import React, { useRef } from "react";
import { FaChevronLeft, FaChevronRight } from "react-icons/fa";
import { useDispatch } from "react-redux";
import "./Allproduct.css";
import { Link } from "react-router-dom";

const categories = [
  { name: "Grocery", img: "data:image/jpeg;base64," },
  { name: "Home", img: "data:image/jpeg;base64," },
  { name: "Fashion", img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQmp1Jv7HWu9cEJR_1ZwtKTlmkgVj73UCWxEw&s" },
  { name: "Tech", img: "data:image/jpeg;base64," },
  { name: "Baby", img: "data:image/jpeg;base64," },
  { name: "Toys", img: "data:image/jpeg;base64," },
  { name: "Health & wellness", img: "data:image/jpeg;base64," },
  { name: "Tech", img: "data:image/jpeg;base64," },
  {name: "Electronics", img: "data:image/jpeg;base64,"},
  {name : "Patio & Garden", img: "data:image/jpeg;base64,"},
  {name: "Home Improvement", img: "data:image/jpeg;base64,"},
  {name: "Sports & Outdoors", img: "data:image/jpeg;base64,"},
];

export default function Allproduct() {
  const scrollRef = useRef(null);
  const scroll = (dir) => {
    if (scrollRef.current) {
      scrollRef.current.scrollBy({
        left: dir === "left" ? -200 : 200,
        behavior: "smooth",
      });
    }
  };

  const handleWheel = (e) => {
    if (scrollRef.current) {
      e.preventDefault();
      scrollRef.current.scrollLeft += e.deltaY;
    }
  };

  return (
    <div className="category-container">
      <div className="category-header">
        <h2>Get it all right here</h2>
        <a href="#">View all</a>
      </div>

      <div className="category-wrapper">
        <button className="scroll-btn left" onClick={() => scroll("left")}>
          <FaChevronLeft />
        </button>

        <div className="category-scroll" ref={scrollRef} onWheel={handleWheel}>
          {categories.map((cat, idx) => (
            <div className="category-item" key={idx}>
              <div className="img-box">
                {/*  Correct Link */}
                <Link to={`/category/${cat.name.toLowerCase()}`}>
                    <img src={cat.img} alt={cat.name} />
</Link>

              </div>
              <p>{cat.name}</p>
            </div>
          ))}
        </div>

        <button className="scroll-btn right" onClick={() => scroll("right")}>
          <FaChevronRight />
        </button>
      </div>
    </div>
  );
}